import React from "react";

import './style.css'

const Mine = () =>{
    return(
        <div>
          <header className="hd"></header>
          <div className="mine-order">我的订单</div>
          <div className="mine-service">待付款 待收货 退换修</div>
          <div className="mine-line">
            <ul><li>收货地址</li> 设置</ul>
          </div>
          我的
        </div>
    )
}

export default Mine
